@keyframes popUp {
  0% {
    transform: scale(0, 0); }
  50% {
    transform: scale(1.5, 1.5); }
  100% {
    transform: scale(1, 1); } }

@keyframes arrow {
  0% {
    transform: translateY(10%); }
  50% {
    transform: translateY(50%); }
  100% {
    transform: translateY(10%); } }

@keyframes slideRight {
  0% {
    transform: translateX(100%); }
  100% {
    transform: translateX(0%); } }

@keyframes slideLeft {
  0% {
    transform: translateX(0%); }
  100% {
    transform: translateX(100%); } }

