/* HTML5 display-role reset for older browsers */
article,
aside,
details,
figcaption,
figure,
footer,
header,
hgroup,
menu,
nav,
section {
  display: block; }

body {
  line-height: 1; }

ol,
ul {
  list-style: none; }

blockquote,
q {
  quotes: none; }

blockquote:before,
blockquote:after,
q:before,
q:after {
  content: '';
  content: none; }

table {
  border-collapse: collapse;
  border-spacing: 0; }

html {
  font-size: 62.5%;
  scroll-behavior: smooth; }

body {
  padding: 0 1rem; }

a {
  color: #b69673; }

.container {
  max-width: 114rem;
  margin: 0 auto;
  padding: 0 5rem;
  padding-bottom: 2rem; }

.h1 {
  font-size: 4rem;
  text-align: center;
  padding-bottom: 5rem;
  padding-top: 3rem; }

.section {
  padding: 5rem 1rem; }

.box {
  background-color: #fafcf2;
  box-shadow: -1px 20px 24px -15px #252528;
  display: flex;
  justify-content: space-around;
  align-items: center;
  padding: 2rem; }

.flipclock {
  display: flex;
  margin: 0 auto; }

.flipclock * {
  box-sizing: inherit; }

.leaf {
  display: flex;
  flex-direction: column;
  margin: 0 4px;
  perspective: 300px; }

.leaf::after {
  content: attr(data-label);
  position: absolute;
  top: 100%;
  left: 50%;
  margin-top: 8px;
  transform: translateX(-50%);
  color: #f2f2f2;
  font-size: 14px;
  font-weight: 400;
  text-transform: uppercase;
  opacity: 0.5; }

.top,
.bottom,
.leaf-front,
.leaf-back {
  position: relative;
  display: block;
  height: 64px;
  width: 120px;
  background-color: #f2f2f2;
  color: #2d3748;
  overflow: hidden;
  border-color: #2d3748; }
  .top span,
  .bottom span,
  .leaf-front span,
  .leaf-back span {
    position: absolute;
    left: 50%;
    width: 100%;
    height: 128px;
    text-align: center;
    font-family: "Impact", sans serif;
    font-size: 80px;
    line-height: 128px;
    transform: translateX(-50%); }

.leaf._3-digits .top,
.leaf._3-digits .bottom,
.leaf._3-digits .leaf-front,
.leaf._3-digits .leaf-back {
  width: 148px; }

.top,
.leaf-front {
  border-top-left-radius: 6px;
  border-top-right-radius: 6px;
  margin-bottom: 1px;
  border-bottom-style: solid;
  border-bottom-width: 1px; }
  .top span,
  .leaf-front span {
    top: 0; }

.leaf-front {
  position: absolute;
  z-index: 10; }

.bottom,
.leaf-back {
  border-bottom-left-radius: 6px;
  border-bottom-right-radius: 6px;
  border-top-style: solid;
  border-top-width: 1px; }
  .bottom span,
  .leaf-back span {
    bottom: 0; }

.leaf-back {
  position: absolute;
  top: 64px;
  z-index: 10; }

@media screen and (max-width: 600px) {
  .flipclock {
    padding: 6.66667vw; }
  .leaf {
    margin: 0 0.66667vw; }
  .leaf::after {
    margin-top: 1.33333vw;
    font-size: 2.33333vw; }
  .top,
  .bottom,
  .leaf-front,
  .leaf-back {
    height: 10.66667vw;
    width: 20vw; }
    .top span,
    .bottom span,
    .leaf-front span,
    .leaf-back span {
      height: 21.33333vw;
      font-size: 13.33333vw;
      line-height: 21.33333vw; }
  .leaf._3-digits .top,
  .leaf._3-digits .bottom,
  .leaf._3-digits .leaf-front,
  .leaf._3-digits .leaf-back {
    width: 24.66667vw; }
  .top,
  .leaf-front {
    border-top-left-radius: 1vw;
    border-top-right-radius: 1vw; }
  .bottom,
  .leaf-back {
    border-bottom-left-radius: 1vw;
    border-bottom-right-radius: 1vw; }
  .leaf-back {
    top: 10.66667vw; } }

.leaf-front {
  transform-origin: bottom center;
  transform: rotateX(0deg);
  transform-style: preserve-3d;
  transition-delay: 0.3s; }

.leaf-back {
  transform-origin: top center;
  transform: rotateX(90deg);
  transform-style: preserve-3d;
  transition-delay: 0s; }

.bottom::before {
  content: '';
  display: block;
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 0%;
  background: black;
  background: linear-gradient(180deg, rgba(0, 0, 0, 0.8) 0%, rgba(0, 0, 0, 0) 100%);
  filter: blur(10px); }

.flip .leaf-front {
  transform: rotateX(-90deg);
  transition: transform 0.3s ease-in, background-color 0.3s ease-in, color 0.3s ease-in;
  transition-delay: 0s;
  color: black;
  background-color: #737373; }

.flip .leaf-back {
  transform: rotateX(0deg);
  transition: transform 0.3s ease-in, background-color 0.3s ease-in, color 0.3s ease-in;
  transition-delay: 0.3s; }

.flip .bottom::before {
  transition: height 0.3s ease-in-out;
  transition-delay: 0.15s;
  height: 100%; }

.footer {
  background: #b69673;
  color: #fafcf2;
  text-align: center;
  padding-left: 2rem;
  padding-right: 2rem; }
  .footer-links, .footer-icons {
    display: flex;
    justify-content: center;
    margin-bottom: 1.5rem;
    flex-wrap: wrap; }
  .footer-link {
    color: var(--mainWhite);
    text-transform: capitalize;
    font-size: 2rem;
    margin-right: 1rem;
    letter-spacing: var(--mainSpacing);
    transition: var(--mainTransition); }
  .footer-link:hover {
    color: var(--primaryColor); }
  .footer-icon {
    font-size: 2rem;
    margin-right: 1rem;
    color: var(--mainWhite);
    transition: var(--mainTransition); }
  .footer-icon:hover {
    color: var(--primaryColor); }
  .footer .copyright {
    text-transform: capitalize;
    letter-spacing: 0.1rem;
    font-size: 1.5rem; }
    .footer .copyright .fa-heart {
      color: red; }

.header {
  height: calc(100vh);
  flex-direction: column;
  display: flex;
  justify-content: space-around;
  align-items: center;
  font-style: italic;
  background-color: #fcfdf5; }
  .header .leaf::after {
    color: #b69673; }
  .header div:first-of-type {
    text-align: center; }
  .header__h1 {
    margin-top: 5rem; }
  .header__h1, .header__countdown, .header__arrowDown, .header__imgContianer, .header__img,
  .header img {
    animation: popUp 1s linear; }
  .header__imgContainer {
    max-height: 30rem;
    max-width: 40rem;
    text-align: center;
    margin-top: -5rem;
    margin-bottom: 4rem; }
    .header__imgContainer img {
      max-width: 100%; }
  .header__arrowDown {
    font-size: 3rem;
    animation: arrow 1.5s linear infinite; }
  .header #flower {
    margin: 0 auto;
    margin-top: 4rem;
    margin-bottom: 1rem;
    max-width: 20rem; }
    @media (max-width: 980px) {
      .header #flower {
        margin: 3rem auto; } }

.information {
  background-color: #b69673;
  padding-top: 3rem;
  color: #fafcf2;
  font-style: italic; }
  .information__container {
    padding: 0; }
  .information__details {
    display: flex;
    justify-content: space-between;
    align-items: center; }
    @media (max-width: 980px) {
      .information__details {
        flex-direction: column; } }
    .information__details .details__container {
      font-size: 3rem; }
      @media (max-width: 680px) {
        .information__details .details__container {
          font-size: 2rem; } }
      .information__details .details__container i {
        margin-bottom: 5rem;
        padding-bottom: 1rem; }
  .information__map #gmap_canvas {
    display: flex;
    justify-content: center;
    padding: 0;
    width: 500px;
    height: 400px; }
    @media (max-width: 980px) {
      .information__map #gmap_canvas {
        width: 300px; } }
  .information__map .mapouter {
    padding: 0; }
  .information .fa-phone {
    padding-right: 1rem; }

nav {
  background: #fafcf2;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.1);
  line-height: 1;
  font-size: 3rem;
  font-style: italic;
  width: 100%;
  position: fixed;
  z-index: 10000; }

.nav__imgContainer {
  max-width: 22rem; }
  .nav__imgContainer img {
    width: 100%; }

.nav-header {
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 1rem; }

.nav-toggle {
  font-size: 1.5rem;
  color: #b69673;
  background: transparent;
  border-color: transparent;
  transition: all 0.3s linear;
  cursor: pointer; }

.logo {
  margin-bottom: 0;
  font-weight: 700; }

.social-icons {
  display: none; }

.links a {
  color: #102a42;
  font-size: 1rem;
  text-transform: capitalize;
  display: block;
  padding: 0.75rem 1rem;
  transition: all 0.3s linear;
  font-size: 2rem; }

.links a:hover {
  background: #fafcf2;
  color: #b69673;
  padding-left: 1.5rem; }

.links {
  margin: 0;
  height: 0;
  overflow: hidden;
  transition: all 0.3s linear;
  /* todo height overflow transition */
  /* get height 160px 10rem*/ }

.show-links {
  height: 10rem; }

.fa-bars {
  font-size: 3rem;
  padding-right: 3rem; }

.fa-heart {
  color: red;
  padding: 0 1rem; }

@media screen and (min-width: 800px) {
  .nav-toggle {
    display: none; }
  .nav-center {
    max-width: 1170px;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 1rem; }
  .nav-header {
    padding: 0; }
  .links {
    height: auto;
    display: flex; }
    .links li {
      padding: 1rem; }
  .links a {
    padding: 0;
    margin: 0 0.5rem; }
  .links a:hover {
    padding: 0;
    background: transparent; } }

.timeline {
  background-color: #b69673;
  color: #fafcf2;
  position: relative; }
  .timeline .modal {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background-color: #b69673;
    width: 100%;
    height: 100%;
    z-index: 2;
    text-align: center;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 10rem; }
  .timeline-center {
    display: flex;
    justify-content: center;
    flex-direction: column;
    max-width: 30%;
    margin: 0 auto;
    font-size: 2rem; }
    @media (max-width: 550px) {
      .timeline-center {
        max-width: 70%; } }
  .timeline-item {
    border-top: 2px dashed #fafcf2;
    margin: 0;
    padding: 4rem 2rem;
    position: relative; }
  .timeline p {
    margin-bottom: 0; }
  .timeline-item:nth-child(even) {
    border-left: 2px dashed #fafcf2;
    border-top-left-radius: 2rem;
    border-bottom-left-radius: 2rem;
    margin-right: 2rem;
    padding-right: 0; }
  .timeline-item:nth-child(odd) {
    border-right: 2px dashed #fafcf2;
    border-top-right-radius: 2rem;
    border-bottom-right-radius: 2rem;
    margin-left: 2rem;
    padding-left: 0;
    text-align: right; }
  .timeline-item:first-child {
    border-top: 0;
    border-top-right-radius: 0; }
  .timeline-item:last-child {
    border-bottom-left-radius: 0; }
  .timeline .number {
    position: absolute;
    top: 50%;
    -webkit-transform: translate(-50%, -50%);
    transform: translate(-50%, -50%);
    margin-bottom: 0;
    background: #b69673;
    width: 2rem;
    height: 2rem;
    border-radius: 50%;
    display: grid;
    place-items: center;
    color: #fafcf2;
    font-weight: bold; }
  .timeline-item:nth-child(even) .number {
    left: 0; }
  .timeline-item:nth-child(odd) .number {
    right: 0;
    -webkit-transform: translate(50%, -50%);
    transform: translate(50%, -50%); }

.goodToKnow {
  background-color: #fafcf2;
  color: #b69673;
  font-size: 2rem;
  text-align: center; }
  .goodToKnow__container {
    display: grid;
    grid-template-columns: repeat(auto-fill, minmax(280px, 400px));
    grid-gap: 1rem;
    color: #b69673;
    justify-content: center; }
    .goodToKnow__container .check {
      font-weight: 700;
      margin-bottom: 2rem; }
      @media screen and (min-width: 800px) {
        .goodToKnow__container .check {
          grid-column-start: 1;
          grid-column-end: 3; } }
  .goodToKnow p {
    padding: 2rem; }
  .goodToKnow i {
    padding: 2rem;
    font-size: 3rem; }

.photo__section {
  text-align: center; }

.photo__container {
  font-size: 2rem;
  display: flex;
  justify-content: space-between;
  align-items: center; }
  @media (max-width: 980px) {
    .photo__container {
      flex-direction: column; } }
  .photo__container p {
    padding-bottom: 3rem; }
  .photo__container .img {
    max-width: 35rem;
    box-shadow: -20px -11px 4px -2px #42445a;
    padding-right: 2rem; }
    @media (max-width: 980px) {
      .photo__container .img {
        padding-right: 0;
        order: 2; } }
    .photo__container .img img {
      width: 100%; }
